# define MAX 10
 
float  alloc[MAX][MAX];
void nwmc(float cost[][MAX],float req[],float cap[],int d,int o,float copy[][MAX]){
	// d=j , o=i
	int s1,s2,lc,lc_next=0,m,n,i,j,i_count=0,j_count=0,index,min,choice;
	float total=0;	/*   To check balanced or unbalanced system   */
	s1=0;
		for(m=0;m<o;m++)
		s1=s1+cap[m];
	s2=0;
		for(n=0;n<=d;n++)
		s2=s2+req[n];
		if(s1 != s2)
		{
		printf("\n\nThe given system is unbalanced. To make it balanced press any key-->");
			if(s1 < s2)
			{
			cap[o]=s2-s1;
			o=o+1;
			}
			else if(s2 < s1)
			{
			req[d]=s1-s2;
			d=d+1;
			}
		 printf("\n\nIt is now balanced\n");
		 }
	printf("\nEnter your choice(1/0): ");
	scanf("%d", &choice);
	while(j_count!=d && i_count!=o)
	{	
		m=0;
		n=0;
		lc=999;
		for(i=0;i<o;i++)
		{
			printf("entered for loop with i=%d ",i);
			if(cap[i])
			{
					printf("entered cap-%d ",i);
			for(j=0;j<d;j++)
			{
				printf("cost[%d][%d]-%f && req[j]= %f && m(%d)<=i(%d) && n(%d)<=j(%d)\n",i,j,cost[i][j],req[j],m,i,n,j);
				if (cost[i][j]<lc && req[j])
				{
					/*if(cost[i][j]==lc && n<=j)
						continue;*/
					lc=cost[i][j];
					m=i;
					n=j;
					printf("m = %d\n ",m);
					printf("n = %d\n ",n);
				}
			}
		}
		}
		lc_next=lc;
		printf("lc_next = %d\n ",lc_next);
		index = (req[n]<cap[m] ? 1 : 0);
		printf("index = %d\n ",index);
		if(index){
			min = req[n];
			printf("min = %d\n ",min);
			alloc[m][n] = min;
			req[n] = req[n]-min;
			cap[m] = cap[m]-min;
			j=n;
			for(i=0;i<o;i++)
				copy[i][j] = -1;
			j_count++;
		}
		else{
			min = cap[m];
			printf("min = %d\n ",min);
			alloc[m][n] = min;
			req[n] = req[n]-min;
			cap[m] = cap[m]-min;
			i=m;
			for(j=0;j<d;j++)
				copy[i][j] = -1;
			i_count++;
		}
 
		printf("Allocation Matrix:- \n");
		for(m=0;m<o;m++){
			for(n=0;n<d;n++)
			{
				if(alloc[m][n])
					printf("%5.0f",alloc[m][n]);
				else
					printf("    X");
			}
			printf(" a-%d=%-5.0f\n",m+1,cap[m]);
		}
		printf("b: ");
		for(n=0;n<d;n++)
			printf("%-5.0f",req[n]);
		printf("\n");
		printf("Signature Matrix:- \n");
		for(m=0;m<o;m++)
		{
			for(n=0;n<d;n++)
			{
				if(copy[m][n]!=-1)
					printf("%5.0f",copy[m][n]);
				else
					printf("    *");
			}
			printf("\n");
		}
 
		/*printf("requirement array:- \n");
		for(j=0;j<d;j++)
			printf("%d",req[j]);
		printf("\ncapacity array:- \n");
		for(i=0;i<o;i++)
			printf("%d",cap[i]);*/
 
		printf("\nEnter your choice(1/0): ");
		scanf("%d", &choice);
	}
	for(m=0;m<o;m++)
		for(n=0;n<d;n++)
			if(alloc[m][n]){
				total = total + cost[m][n]*alloc[m][n];
				printf("%4.0f*%-4.0f+",cost[m][n],alloc[m][n]);
			}
	printf("\b= %7.0f",total);
 
}
 
