void myCode(){


ll saved[6][100][6][100]{};


int n ;
cin >> n ;
vector < int > v(n);

for(auto& x : v){
    cin >> x;
    int w = x;
    string s = to_string(x);
    int total =0 , sum =0 ;
    while(w){
        total += w % 10;
        w/=10;
    }
    
    w = x;
    int len1=0 ;
    while(w){
        len1++;
        sum += w % 10 ;
        saved[len1][sum ][sz(s) - len1][total - sum ]++;
        w/=10;
    }
    
}


ll ans =0;

for(auto& x : v ){
    string s = to_string(x);
    int total =0;
    for(auto& c : s ) total += c-'0';
    
    for(int i =1 ; i <= 5 ; i++){
        if(sz(s) > i){
        
            int sum =0;
            for(int j =0 ; j < i ; j++) sum += s[j]-'0';

            if(i - (sz(s) - i) >=0)
                ans += saved[ i - (sz(s) - i) ][total - sum][0][0] ;
            
                // ans += saved[0][0] [ i - (sz(s) - i) ][total - sum] ;
                
        }
        
        else{
                
            for(int k = 0 ; k <=  9 * (i-sz(s)) ; k++){    
                
                ans += saved [i] [total + k][i-sz(s)] [k];
                ans += saved [i-sz(s)] [k] [i] [total + k];
            }
          
        }
    }
}


cout << ans << nl; 


}


