#define RH_ENCODER_A 3
#define RH_ENCODER_B 8

bool mean = 0;
bool newmean = 0;
uint32_t counter = 0;

void setup() {

  pinMode(RH_ENCODER_A, INPUT);
  pinMode(RH_ENCODER_B, INPUT);
  Serial.begin(9600);
}



void loop() {
  newmean = digitalRead(RH_ENCODER_B);
  if (mean != newmean) {
    counter++;
    Serial.print("count = ");
    Serial.println(counter);
    mean = newmean;
  }
}

