#include <iostream>

using namespace std;

class FudbalskaEkipa {
private:
    string ime_na_ekipa;
    int godina_na_sostavuvanje;
    int broj_na_poeni;
    int pobedi;
    
public:
    FudbalskaEkipa() {
        
    }
    FudbalskaEkipa(string ime_na_ekipa, int godina_na_sostavuvanje, int broj_na_poeni, int pobedi) {
        this->ime_na_ekipa = ime_na_ekipa;
        this->godina_na_sostavuvanje = godina_na_sostavuvanje;
        this->broj_na_poeni = broj_na_poeni;
        this->pobedi = pobedi;
    }
    FudbalskaEkipa & operator += (FudbalskaEkipa & tmp) {
        if(this->broj_na_poeni > tmp.broj_na_poeni) {
            this->pobedi += 1;
        }
        else {
            tmp.pobedi += 1;
        }
        return (*this);
    }
    void print() {
        cout << ime_na_ekipa << " " << godina_na_sostavuvanje << " " << broj_na_poeni << " " << pobedi << endl;
    }
};

int main() {
    FudbalskaEkipa f1("Real madrid", 1950, 70, 2);
    FudbalskaEkipa f2("Barcelona", 1970, 100, 3);
    
    f1 += f2;
       
    f1.print();
    f2.print();
    
    
    
    return 0;
}

#include <iostream>

using namespace std;

class Point {
private:
    int x, y;
    
public:
    Point() {
        
    }
    Point(int x, int y) {
        this->x = x;
        this->y = y;
    }
    
    Point & operator += (Point tmp) {
        this->x += tmp.x;
        this->y += tmp.y;
        
        return *this;
    }
    Point & operator -= (Point tmp) {
        this->x -= tmp.x;
        this->y -= tmp.y;
        
        return *this;
    }
    Point & operator *= (Point tmp) {
        this->x *= tmp.x;
        this->y *= tmp.y;
        
        return *this;
    }
    Point & operator /= (Point tmp) {
        this->x /= tmp.x;
        this->y /= tmp.y;
        
        return *this;
    }
    void print() {
        cout << this->x << " " << this->y << endl;
    }
};

int main() {
       
    Point p1(1, 2);
    Point p2(2, 3);
    p1 /= p2;
    
    
    
    p1.print();
    
    return 0;
}

